import React from 'react'
import { data } from '../../data'

const QuestionBlock = () => {
    console.log("data",data.questions.map((d)=> d.questionoption))
  return (
    <div>
      {data.questions.map((data,key)=> {
        return (
            <div key={key}>
                {data.question}
                {data.questionoption.map((question,key)=>{
                    return (
                        <input type="radio">{question.optionvalue}</input>
                    )
                })}
            </div>
        )
      })}
    </div>
  )
}

export default QuestionBlock
